export default () => {
  const colDef = [
    {
      Header: 'SKU',
      accessor: 'sku',
      disableGroupBy: true,
      //   width: 50,
      align: 'center',
    },
    {
      Header: 'Metrics',
      accessor: 'metrices',
      disableGroupBy: true,
      //   width: 50,
      align: 'left',
    },
    {
      Header: 'W1',
      accessor: 'w1',
      disableGroupBy: true,
      //   width: 55,
      align: 'left',
    },
    {
      Header: 'W2',
      accessor: 'w2',
      disableGroupBy: true,
      //   width: 50,
      align: 'left',
    },
    {
      Header: 'W3',
      accessor: 'w3',
      disableGroupBy: true,
      //   width: 55,
      align: 'left',
    },
    {
      Header: 'W4',
      accessor: 'w4',
      disableGroupBy: true,
      //   width: 55,
      align: 'left',
    },
    {
      Header: 'W5',
      accessor: 'w5',
      disableGroupBy: true,
      //   width: 50,
      align: 'left',
    },
  ];
  return colDef;
};
